import React, { useEffect, usestate } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Link, useNavigate } from "react-router-dom"
import * as ProviderActions from "../../store/provider.js"
import * as sectionActions from "../../store/section.js"
function Submission() {
    const dispatch = useDispatch()
    const history = useNavigate()
    const submission = useSelector((state) => state.provider?.zipCodeCode)
    const result = useSelector((state) => state.provider?.provider)
    const zipCode = useSelector((state) => state.provider?.zipCodeCode.zipCodeCode)
    const Name = submission.Name
    const Address = submission.address
    const Phone = submission.phone
    const City = submission.city
    const State = submission.state
    const sub = Object.values({...result, ...Name, Address, Phone, City, State, zipCode})
    const pro = {...result, ...Name, Address, Phone, City, State, zipCode}
    const {  



        tate,


        Users,
        Approved,
        domesticViolence,
        LGBTQ,
        crisisResources,
        humanTrafficking,
        military,
        lawEnforcement,
        elderSurvivor,
        maleSurvivor,
        childSurvivor,
        confidential,
        nonConfidential,
        healthCenter,
        dvProgram,
        psychProgram,
        callpolice,
        advocacyProgram,
        legalAdvice,
        forensicExams,
        generalHealth,
        pregnancy,
        housing,
        collegeOnCampus,
        title9,
        tribal,
        coalition,
        std,
        hivSupport,
        immigrants,
        blindDeaf,
        disabled,
        directCareCo,
        directCareMed,
        directCareOther,
        substanceAbuse,
        missingPersons,
        specialNeeds,
        alternativeCare,  } = submission
    const handleSubmit = (e) => {
        e.preventDefault()
        console.log(pro)
